import Link from 'next/link';

const GoBack = ({ city }) => {
  return (
    <div className={dailyStyles.top}>
      <Link href={`/city/weather?city=${city}`}><a className={dailyStyles.back}>&#8592; Go back</a></Link>
      <p><span>C</span> | <span>F</span></p>
    </div>
  )
}

export default GoBack;
